import React from "react";
import Popular from "../../../interfaces/Popular";
import '../HomePage.scss';

interface PopularProps {
  populars: Popular[];
}

const PopularItem: React.FC<Popular> = ({key, restaurantName, chefName, restaurantImage}: Popular) => {
  return (
    <div className="data-item">
      <p>{key}</p>
      <p>{chefName}</p>
      <p>{restaurantName}</p>
      <img src={restaurantImage} alt="img"></img>
    </div>
  );
};


const PopularRestaurant: React.FC<PopularProps> = ({
  populars,
}: PopularProps) => {
  return (
    <div>
      {populars.map((item) => {
        return (
          <PopularItem
            key={item.key}
            chefName={item.chefName}
            restaurantName={item.restaurantName}
            restaurantImage={item.restaurantImage}
          ></PopularItem>
        );
      })}
    </div>
  );
};

export default PopularRestaurant;
